【キーケース レディース 6連 かわいい エナメル レザー ブランド 人気】<br><br>

表面に花柄模様が型押しされた小ぶりで可愛いキーケースです。<br>

エナメル加工が施されているので程よい光沢がとっても良いです。<br><br>

キーフックは6ヶ所あり鍵などをたくさん収納できます。<br>
またキーリングも付いておりますので、<br>
良く使う鍵などを付けておけばすぐに取り出せます。<br><br>

カラーは全部で3色展開で、鮮やかな色使いでとてもお洒落です。<br>
プレゼントにも最適な商品ですので是非お試しください。<br><br>

<br>

◆素材◆<br>
合成皮革
  <br><br> 
◆本体サイズ◆<br>
約  H8cm×W12cm×D2cm<br><br>

◆仕様◆<br>
キーフック×6、キーリング×1<br><br>



  <br>


※現物に近い色が出る様に写真を撮っておりますが、多少濃く見えたり、薄く見えたりする場合がございます。<br>
新品未使用品ですが、商品の性質や構造上により、どうしても小さい傷などが生じる場合が御座います。
